import logo from './logo.svg';
import './App.css';

function App() {

  const title = 'Welcome to the blog';
  const likes = 100;

  return (
    <div className="App">
      <div className="content">
        <h1>{title}</h1>
        <p>liked {likes} times</p>
        <p>{Math.random() * 10}</p>
        <p>{[1,2,3,4,5]}</p>
      </div>
    </div>
  );
}

export default App;
